import React from 'react';
import '../../App.css';

export default function Services() {
  return (
    <div className="services-page">
      <div className="services-photo"></div>
      <div className="services-text">
        <h1 className="services">CONTACT ME PLZ</h1>
        <p>
          One thing I HATE to do is sleep on bad terms. Last night it was late, and my fault but idk I just can't sleep properly. I would rather have you in my presence, on call, even if we are saying nothing. Your presence, in an empty room 
        </p>
      </div>
    </div>
  );
}
